import React from 'react';
import './styles/List.css';

export interface ScanResult {
  id: number;
  repositoryName: string;
  status: 'Queued' | 'In Progress' | 'Success' | 'Failure';
  findings: any[];
  timestamp: string;
}


const ScanResultList: React.FC<{ results: ScanResult[] }> = ({ results }) => {
  return (
    <table className="table">
      <thead>
        <tr>
          <th>Repository Name</th>
          <th>Status</th>
          <th>Findings</th>
          <th>Timestamp</th>
        </tr>
      </thead>
      <tbody>
        {results.map((result) => (
          <tr key={result.id}>
            <td>{result.repositoryName}</td>
            <td><span className={`badge ${result.status.toLowerCase().replace(' ', '-')}`}>{result.status}</span></td>
            <td><span className="badge">{result.findings.length}</span></td>
            <td>{result.timestamp}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default ScanResultList;
